import React from 'react';
import "./WorkCard.css";

function WorkCard(props) {

    let list = props.techUsed.map((item) => 
        <li>{item}</li>
    );
    return(
        <div className="workCard">
        <h2>{props.title}</h2>
        <h4>{props.company}</h4>
        <p><b>Technology Used:</b></p>
        <ul>
        {list}
        </ul>
        <p><b>Responsibilities:</b> {props.description}</p>
        <p><b>Duration:</b> {props.dateRange}</p>
        </div>

    );
}


export default WorkCard;
